import React from 'react';

const Navigation = ({ onRouteChange, isSignedIn }) => {
    if (isSignedIn){ // When isSignedIn is true, show the navigation "Sign Out"
        return (
            <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={() => onRouteChange('signout')} className='f3 link dim black underline pa3 pointer'>Sign Out</p>
                <p onClick={() => onRouteChange('category')} className='f3 link dim black underline pa3 pointer'>Search</p>
                <p onClick={() => onRouteChange('form')} className='f3 link dim black underline pa3 pointer'>Form</p>
            </nav>
    );
    } else { // When SignedIn is false, show the navigation "Sign In" and "Register"
        return (
            <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pa3 pointer'>Sign In</p>
                <p onClick={() => onRouteChange('register')} className='f3 link dim black underline pa3 pointer'>Register</p>
            </nav>
        );
    }
}

export default Navigation;
